import { useState } from "react";
import NewReview from "./components/NewReview/NewReview"; 
import ReviewsBlock from "./components/ReviewsBlock/ReviewsBlock";
import { ReviewData } from "./ReviewData";
import "./App.css";

function App() {
  const [reviews, setReviews] = useState<ReviewData[]>([]);

  const defaultCriteriasNames: string[] = [
    "Cleanliness",
    "Customer Service",
    "Speed",
    "Location",
    "Facilities"
  ]

  const avatarBase64 = "data:image/png;base64,"
  const handleNewReview = (rating: number, text: string) => {
    setReviews([
      ...reviews,
      {
        name: " ",
        photo: avatarBase64,
        rating,
        text,
      }
    ]);
  };

  return (
    <>
      <NewReview 
        criteriasNames={defaultCriteriasNames}
        onNewReview={(rating, text) => handleNewReview(rating, text)}
      />

      <ReviewsBlock
        reviews={reviews}
      />
    </>
  );
}

export default App;